import React from "react";

import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link,
  } from "react-router-dom";

import {
    AiFillCustomerService,
    AiFillHome
  } from "react-icons/ai";

const Home = () => {
    return (
        <div className="home-body">
            <div className="content-1">
                <div className="linkbox">
                    <ul>
                        <li>
                            <span class="icon"><AiFillHome /></span>
                            <Link to={`/`} class="listlink">Home</Link>
                        </li>
                        <li>
                            <span class="icon"><AiFillCustomerService /></span>
                            <Link to={`/albums`}><span class="text">Albums</span></Link>
                        </li>
                        <li>
                            <Link to={`/photos`}><span class="text">Photos</span></Link>
                        </li>
                        <li>
                            <Link to={`/scribbles`}><span class="text">Scribbles</span></Link>
                        </li>
                        <li>
                            <Link to={`/links`}><span class="text">Links</span></Link>
                        </li>
                        <li>
                            <Link to={`/about`}><span class="text">About</span></Link>
                        </li>   
                    </ul>
                </div>
            </div>
        </div>
    );
};

export default Home;
